Ab und zu habe ich hier Bilder von meiner zweiten großen Leidenschaft gezeigt. Der Garten ist für mich nicht nur ein Platz zum Kraft tanken und abschalten, er ist mir auch eine große Quelle der Inspiration. Die Malerei beschäftigt mich bewusst schon einiges länger als das Gärtnern. Wobei der Grundstein zum Gärtnern auch schon in meiner Kindheit gelegt wurde. Nämlich im Schrebergarten meiner Eltern. Allerdings kam die Leidenschaft erst viel, viel später, vor ein paar Jahren erst. Die Malerei allerdings hat mich damals schon  gefesselt.

Seit kurzem beschäftige ich mich wieder intensiver mit der Welt der Farben und möchte das etwas vom Garten trennen.

Wer also Lust auf ein paar farbenfrohe, von der Natur inspirierte Quatrate hat. Hüpft doch mal rüber zu @wildundbunter_malerei.

